import React from "react";
import "./advertising.css";
import mac from "../../image/mac.png";
function Advertising() {
  return (
    <div className="bg">
      <div className="advert">
        <div className="advert__content">
          <img src={mac} alt="404" />
          <div className="advert__txt"><></></div>
        </div>
      </div>
    </div>
  );
}

export default Advertising;
